const Head = (props) => {
  return (
    <div>
      <h1>{props.course}</h1>
    </div>
  )
}

const Content = (props) => {
  return (
    <div>
      <p>{props.part} {props.exercises}</p>
    </div>
  )
}

const Total = (props) => {
  return (
    <div>
      <p>
        {props.num}
      </p>
    </div>
  )
}

const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <Head course = {course}/>
      <Content part = {part1} exercises = {exercises1}/>
      <Content part = {part1} exercises = {exercises1}/>
      <Content part = {part1} exercises = {exercises1}/>
      <Total Number of exercises num = {exercises1 + exercises2 +exercises3}/>
    </div>
  )
}


ReactDOM.render(

   <App />,

  document.getElementById('root')
);

